import React from 'react';
import { Link } from 'react-router-dom';
import ap from './img/Screenshot 2024-11-10 011700.png';
import std from './img/Screenshot 2024-11-10 011804.png';
import off from './img/Screenshot 2024-11-10 011837.png';

const PropertyListPage = () => {
  const properties = [
    { id: 1, name: 'Luxury Apartment', price: '$500,000', image: ap },
    { id: 2, name: 'Cozy Studio', price: '$200,000', image: std },
    { id: 3, name: 'Office Place', price: '$800,000', image: off }
  ];

  return (
    <div className="queue-card-container">
      {properties.map((property) => (
        <div key={property.id} className="property-card">
          <img src={property.image} alt={property.name} className="property-image" />
          <h3>{property.name}</h3>
          <p>Price: {property.price}</p>
          <Link to={`/property/${property.id}`} className="details-link">
            View Details
          </Link>
        </div>
      ))}
    </div>
  );
};

export default PropertyListPage;
